import React from 'react';
import Layout from '../../components/Layout/Layouts';
import { IoPartlySunnyOutline } from "react-icons/io5";
import './Dashboard.css';
const Dashboard = () => {

    return (
        <Layout>
            <h1>
                <IoPartlySunnyOutline />
                <h2> Guten Tag </h2><br />
                <h2> Admin </h2>
            </h1>

        </Layout>
    )

}

export default Dashboard;
